script: |
  super -f text -I q7330.spq | sort > q7330.out

inputs:
  - name: q7330.spq
    data: |
      SELECT col1 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT NULL <= col2 + col1 * ( col1 ) * 24 * + 86 * col0 + + - col1 + + 72 + + 25;
  - name: tab2

outputs:
  - name: q7330.out
    data: |
